import React from 'react';
import './App.css';
import axios from 'axios';
import { navigate } from '@reach/router';

function App() {
  const [displayname, setDisplayname] = React.useState('DisplayName not set');
  const [username, setUsername] = React.useState('Username not set');

  const getAuthenticatedUser = () => {
    axios.get("http://localhost:8000/login/getauthenticateduser", { withCredentials: true })
    .then(response => {
      console.log(JSON.stringify(response.data.result));
      setDisplayname(response.data.result.name);
      setUsername(response.data.result.username);
    })
    .catch(err => console.log(JSON.stringify(err)));
  }

  return (
    <div className="App">
      <a href="http://localhost:8000/login/github_redirect">Github Login</a>
      <button onClick={getAuthenticatedUser}>Get Authenticated User</button>
      <h1>DisplayName: {displayname}</h1>
      <h1>UserName: cookie: {username}</h1>
    </div>
  );
}

export default App;
